import React from 'react';


export default function Imaginante({matricula, nombre , grupo, correo}) {
  
    return (

        <tr>
            <td>{matricula}</td>
            <td>{nombre}</td>
            <td>{grupo}</td>
            <td>{correo}</td>
        </tr>

    );
}
